import '../../index.css';

function TableItem({year,totalSavings, yearlyInterest, yearlyContibution}) {
   let totalInterest = (year > 1) ? (totalSavings - yearlyContibution) : yearlyInterest; 
    console.log(year,totalSavings);
    return (
        <tr>
        <td>{year}</td>
        <td>${totalSavings}</td>
        <td>${yearlyInterest}</td>
        <td>${totalInterest}</td>
        <td>${yearlyContibution}</td>
        </tr>
    )
}

